import { Card } from 'semantic-ui-react'

function LogList({ logs }) {
  function mapLogsToItems(logs) {
    return logs.map(log => ({
      header: log.hours,
      image: log.mediaUrl,
      meta: `$${log.hours}`,
      color: "teal",
      fluid: true,
      childkey: log._id,
      href: `/log?_id=${log._id}`
    }));
  }
  return <Card.Group stackable itemsPerRow="3" centered items ={mapLogsToItems(logs)} />
};

export default LogList;
